É assim que as feridas cicatrizam. Aqui você pode acompanhar 3 estágios de cura:

Primeiro: coagulação do sangue ou hemostasia - as plaquetas não dormem e se ligam rapidamente ao local da lesão. Depois, há uma limpeza - a fagocitose ("devoradora") alivia a ferida de células danificadas e mortas. No terceiro estágio, um novo tecido cresce e a ferida encolhe.

